import React from 'react'
import './index.sass'
import AdItem from '../AdItem'

export default function ({ ads }) {
    return <ul className="results">
        {ads.map(ad => <li className="results__item" key={ad.id}><AdItem ad={ad} /></li>)}
    </ul>
}
